import React from 'react'
import {Switch,Route} from 'react-router-dom'
import ReactHome from './content/React-Home'
import ReactEnvironment from './content/React-environment'
import Layout from './Layout'

const Router=()=>{
  return(
    <Layout >
     <Switch>
    <Route exact path='/' component={ReactHome}/>
    <Route  exact path='/environment' component={ReactEnvironment}/>
  </Switch>
  </Layout>
  )

}

export default Router;
